  \"application-of-the-sea-level-affecting-marshes-model-slamm-6-to-potomac-river-nwr-complex\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This Sea-Level Affecting Marshes Model
  (SLAMM) report presents a model for projecting the effects of sea-level rise on
  coastal marshes and related habitats on Potomac River NWR Complex.  The model is
  spatially explicit, using GIS technology to produce maps and tables that summarize
  the projected effects.  The SLAMM simulations include five primary processes that
  affect wetland fate under different scenarios of sea-level rise including: inundation,
  erosion, overwash, saturation, and accretion.\",\n\t\"license_title\": \"License
